import React from "react";
import { Switch, Route } from "react-router-dom";
import Home from "../Home";
import Topbar from "../../component/Topbar";
import Sidebar from "../../component/Sidebar";

function App() {
  return (
    <div className="App">
      <Topbar />
      <Sidebar />
      <Switch>
        <Route exact path="/"><Home /></Route>
      </Switch>
    </div>
  );
}

export default App;
